<template>
	<view class="text-white text-center padding-bottom-ten box"
	      style="background-repeat:repeat-y;background-size:100% 120%">
		<view style="height: 160rpx"></view>
		<view class="full-width text-center" style="position: relative;width: 100%;height: 160rpx">
			<view :class="[isPlay&&!isPlayEnd ? 'pulse' : '']"
			      style="position: absolute;top:50%;left:50%;margin-top: -120rpx;margin-left: -120rpx;width: 240rpx;height: 240rpx;border-radius: 50%;border: 4px solid white;"></view>
			<view :class="[isPlay&&!isPlayEnd ? 'pulse' : '']"
			      style="position: absolute;top:50%;left:50%;margin-top: -150rpx;margin-left: -150rpx;width: 300rpx;height: 300rpx;border-radius: 50%;border: 3px solid white;opacity: 0.7;"></view>
			<view :class="[isPlay&&!isPlayEnd ? 'pulse' : '']"
			      style="position: absolute;top:50%;left:50%;margin-top: -180rpx;margin-left: -180rpx;width: 360rpx;height: 360rpx;border-radius: 50%;border: 2px solid white;opacity: 0.3;"></view>
			<image v-if="!isPlay" :mode="['aspectFit', 'scaleToFill', 'aspectFill', 'widthFix', 'heightFix'][3]"
			       src="/static/images/anniu@2x.png"
			       style="position: absolute;top:50%;left:50%;transform:translate(-50%,-50%);width: 196rpx;height: 196rpx"></image>
			<view v-else :class="[isPlayEnd ? 'text-20' : 'text-30']"
			      class="text-white text-bold text-center"
			      style="position: absolute;top:50%;left:50%;transform:translate(-50%,-50%);width: 196rpx;height: 196rpx;line-height: 196rpx;border-radius: 50%;background: rgb(24, 81, 219)">
				{{ schedule }}{{ isPlayEnd ? '' : '%' }}
			</view>
		</view>
		<view style="height: 80rpx"></view>
		<view class="text-14" style="margin-top: 96rpx">【原理】：利用特定声波震动，使灰尘脱离扬声器</view>
		<view class="text-18" style="margin-top: 26rpx">请将手机音量调至最大</view>
		<view class="text-18" style="margin-top: 30rpx;height: 96rpx;line-height: 96rpx;width: 86%;margin-left: 7%;background: #FF4343;border-radius: 24px;"
		      @click="playAudio">
			{{ promptText }}
		</view>
		<view
			style="width: 90%;background: rgba(255, 255, 255, 0.3);height: 394rpx;border-radius: 17px;margin-left: 5%;padding: 26rpx 14rpx;margin-top: 30rpx">
			<view class="text-16 text-left">声波清理秘籍</view>
			<view style="background: #FF4343;height: 4rpx;width: 190rpx;margin-top: 4rpx"></view>
			<view class="text-12 text-left" style="margin-top: 18rpx">清理手机扬声器的声波是有用的。</view>
			<view class="text-12 text-left" style="margin-top: 10rpx;line-height: 36rpx">
				清理手机扬声器的音波是利用声波震动的原理，将音频调整至140~165Hz，可以将手机里的灰震出来，不用拆手机就能解决清灰问题。
			</view>
			<view class="text-12 text-left" style="margin-top: 0rpx;line-height: 36rpx">
				当然清理出来的灰尘也是细小的，肉眼自然看不见很多灰尘出来。部分双扬声器的手机听筒也可以发声，所以这个方法也可以为听筒清灰。
			</view>
		</view>

		<view style="width: 90%;margin: 50rpx 0 50rpx 5%">
			<ad ad-intervals="30" unit-id="adunit-00e1022d0ea25478"></ad>
		</view>


		<button class="text-18 text-white" open-type="share"
		        style="margin-top: 30rpx;height: 96rpx;line-height: 96rpx;width: 86%;margin-left: 7%;background: #FF4343;border-radius: 24px;">分享
		</button>
	</view>
</template>

<script lang="ts">
import { Component, Vue } from 'vue-property-decorator'

@Component({})
export default class index extends Vue {
	isPlay: boolean = false
	isPlayEnd: boolean = false
	adNoEnd: boolean = false
	schedule: any = 0
	promptText: string = '观看视频 清理灰尘'
	videoAd: any = null
	interstitialAd: any = null
	rewardedVideoAd: any = null

	onShareAppMessage () {
		return {
			path: 'pages/index/index',
		}
	}

	onLoad () {
		this.rewardedVideoAd = null
		if (wx.createInterstitialAd) {
			this.rewardedVideoAd = wx.createRewardedVideoAd({
				adUnitId: 'adunit-b1a2e6819f2e59de'
			})
			this.rewardedVideoAd.onLoad(() => {
				console.log('激励广告加载成功')
			})
			this.rewardedVideoAd.onError((err) => {
				console.log('激励广告出错', err)
			})
			this.rewardedVideoAd.onClose((res) => {
				console.log(res, '用户关闭广告')
				// 用户点击了【关闭广告】按钮
				if (res && res.isEnded) {
					// 正常播放结束，可以下发游戏奖励
					this.realPlay()
					if (this.promptText == '再测一次') {
						this.schedule = 0
						this.isPlayEnd = false
					}
				} else {
					// 播放中途退出，不下发游戏奖励
					// this.realPlay()
					this.adNoEnd = true
					// this.schedule = '未清理'
					this.$mio.mioRoot.showToast('还未看完视频，无法清理..')

				}
			})
		}
	}

	playAudio () {
		this.$mio.mioRoot.showToast('正在拉取视频..')
		// 用户触发广告后，显示激励视频广告
		this.rewardedVideoAd.show().catch(() => {
			// 失败重试
			this.rewardedVideoAd.load()
				.then(() => this.rewardedVideoAd.show())
				.catch(err => {
					console.log('激励视频 广告显示失败', err)
				})
		})
	}

	realPlay () {
		const innerAudioContext = uni.createInnerAudioContext()
		innerAudioContext.autoplay = true
		innerAudioContext.src = '/static/images/voice.mp3'
		this.isPlay = true
		this.schedule = 0
		this.isPlayEnd = false
		this.promptText = '正在清理'
		const timer = setInterval(() => {
			this.schedule += 10
			if (this.schedule == 100) {
				setTimeout(() => {
					this.isPlayEnd = true
					clearInterval(timer)
					this.schedule = '清理完成'
					this.promptText = '再测一次'
					innerAudioContext.pause()
					innerAudioContext.destroy()
				}, 1000)
			}
		}, 1000)

		innerAudioContext.onPlay(() => {
			console.log('开始播放')
		})
		innerAudioContext.onError((res) => {
			console.log(res.errMsg)
			console.log(res.errCode)
		})
	}
}
</script>

